// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.0;

import "./Permissions.sol";
contract VoteChain {
    Permissions permissions;
    constructor(address permissionsAddress) {
        permissions = Permissions(permissionsAddress);
    }

    enum ElectionStatus { Inactive, Active, Finished }

    struct ElectionInfo {
        uint256 id;
        string name;
        string description;
        uint256 startDate;
        uint256 endDate;
        ElectionStatus status;
    }

    mapping(uint256 => mapping(address => bool)) public voterVoted;            // list of voters who have voted in an election
    mapping(uint256 => mapping(address => uint256)) public candidateVoteCount; // list of candidates and their vote count in an election
    mapping(uint256 => ElectionInfo) public elections;                         // list of elections

    mapping(address => mapping(uint256 => uint256)) public eligibleElections; // list of eligible elections
    mapping(address => uint256) eligibleElectionsCount;                        // Eligible elections count
    mapping(uint256 => address payable) public eligibleCanidates;              // list of eligible voters

    event ElectionCreated(uint256 electionId);
    event ElectionStarted(uint256 electionId);
    event ElectionEnded(uint256 electionId);
    event VoteCasted(uint256 electionId, address indexed voterAddress);

    modifier onlyAdmin(Permissions.AdminRole role) {
        require(permissions.requireAdmin(role),"You dont have permission to perform this action.");
        _;
    }

    /*
        All functions a voter can access
    */
    
    function getEligibleElections() public view returns (ElectionInfo[] memory){
        ElectionInfo[] memory electionInfos = new ElectionInfo[](0);
        for (uint256 i = 0; i < eligibleElectionsCount[msg.sender]; i++) {
            electionInfos[i] = elections[eligibleElections[msg.sender][i]];
        }
        return electionInfos;
    }

    function vote(uint256 electionId, address payable candidateAddress) public {
        require(elections[electionId].status == ElectionStatus.Active, "Election is not active.");
        require(!voterVoted[electionId][msg.sender], "User already voted.");
        voterVoted[electionId][msg.sender] = true;
        candidateVoteCount[electionId][candidateAddress] += 1;
        emit VoteCasted(electionId, msg.sender);
    }

    /*
        All functions an admin can access
    */

    function createElection(
        string memory _name,
        string memory _description,
        uint256 _startDate,
        uint256 _endDate
    ) public onlyAdmin(Permissions.AdminRole.Authority) {
        uint256 electionId = address(this).balance;
        elections[electionId] = ElectionInfo({
                id: electionId,
                name: _name,
                description: _description,
                startDate: _startDate,
                endDate: _endDate,
                status: ElectionStatus.Inactive
            }
        );
        emit ElectionCreated(electionId);
    }

    function startElection(uint256 electionId) public onlyAdmin(Permissions.AdminRole.Authority) {
        require(block.timestamp >= elections[electionId].startDate, "Election cannot be started before start date.");
        elections[electionId].status = ElectionStatus.Active;
        emit ElectionStarted(electionId);
    }

    function endElection(uint256 electionId) public onlyAdmin(Permissions.AdminRole.Authority) {
        require(block.timestamp >= elections[electionId].endDate, "Election cannot be ended before end date.");
        elections[electionId].status = ElectionStatus.Finished;
        emit ElectionEnded(electionId);
    }

    function addEligibleVoter(uint256 electionId, address payable voter) onlyAdmin(Permissions.AdminRole.LocalityOfficer) public {
       eligibleElections[voter][eligibleElectionsCount[voter]] = electionId;
    }

    function addEligibleCandidates(uint256 electionId, address payable[] memory _candidates) public onlyAdmin(Permissions.AdminRole.ReturningOfficer) {
        for (uint256 i = 0; i < _candidates.length; i++) {
            eligibleCanidates[electionId] = _candidates[i];
        }
    }
}
